// Home Section
import React from "react";
import Button from '@material-ui/core/Button';
import './Intention.css'
import ArrowForwardIcon from '@material-ui/icons/ArrowForward';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';
import { Container, Link, ButtonContainer } from "./IntentionElements";
import { Redirect } from "react-router-dom";

class IntentionPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            selectedOption: "100",
            redirectToSong: false
        };
    }

    handleOptionChange = changeEvent => {
        this.setState({
            selectedOption: changeEvent.target.value
        });
    };

    handleFormSubmit = formSubmitEvent => {
        formSubmitEvent.preventDefault();
        console.log("You have submitted:", this.state.selectedOption);
        this.setState({
            redirectToSong: true
        })
    };

    render() {
        const redirectToSong = this.state.redirectToSong;
        if (redirectToSong) {
            return <Redirect to="/song" />
        }
        return (
            <Container>
                <div className="feel__SelectFeel">
                    <h2>I want to feel:</h2><br /><br />
                    <form onSubmit={this.handleFormSubmit}>
                    <div className="feel_SelectButtons">
                        <Button variant="contained" color="secondary"
                            className="feel_Button">
                            Energized
                        </Button>
                        <Button variant="contained" color="secondary"
                            className="feel_Button">
                            Reflective
                        </Button>
                        <Button variant="contained" color="secondary"
                            className="feel_Button">
                                Not Sure
                        </Button>
                    </div>
                    </form>
                    <br /><br /><br /><br /><br /><br /><br /><br />
                    <ButtonContainer>
                        <Link to="/journal" className="back_icon__Link"> <ArrowBackIcon /> </Link>
                        <Link to="/song" className="next_icon__Link"><ArrowForwardIcon /></Link>
                    </ButtonContainer>
                </div>
            </Container>
        )
    }
}


export default IntentionPage;
